 -- Criação da Base de Dados
CREATE DATABASE IbmHrEmployee;
GO

--DROP DATABASE IbmHrEmployee;

-- Escolher a Database 
USE IbmHrEmployee;
GO

-- Criação das tabelas
CREATE TABLE Department (
    DepartmentID INT PRIMARY KEY IDENTITY(1,1),
    Department NVARCHAR(30) NOT NULL
);
GO


CREATE TABLE EducationField (
    EducationFieldID INT PRIMARY KEY IDENTITY(1,1),
	EducationField NVARCHAR(30) NOT NULL
);
GO

CREATE TABLE JobRole (
    JobRoleID INT PRIMARY KEY IDENTITY(1,1),
	JobRole NVARCHAR(30) NOT NULL
);
GO

CREATE TABLE BusinessTravel (
    BusinessTravelID INT PRIMARY KEY IDENTITY(1,1),
	BusinessTravel NVARCHAR(30) NOT NULL
);
GO

CREATE TABLE Gender (
    GenderID INT PRIMARY KEY IDENTITY(1,1),
	Gender NVARCHAR(10) NOT NULL
);
GO

CREATE TABLE MaritalStatus (
    MaritalStatusID INT PRIMARY KEY IDENTITY(1,1),
	MaritalStatus NVARCHAR(30) NOT NULL
);
GO

CREATE TABLE Compensation (
    CompensationID INT PRIMARY KEY IDENTITY(1,1),
	DailyRate INT NOT NULL,
	HourlyRate INT NOT NULL,
	MonthlyIncome INT NOT NULL,
	MonthlyRate INT NOT NULL,
	PercentSalaryHike INT NOT NULL,  -- (real, null)
	StockOptionLevel BIT NOT NULL,
	OverTime NVARCHAR(3) NOT NULL,
	StandardHours SMALLINT NOT NULL
);
GO

CREATE TABLE WorkHistory (
    WorkHistoryID INT PRIMARY KEY IDENTITY(1,1),
	DistanceFromHome INT NOT NULL,
	NumCompaniesWorked SMALLINT NOT NULL,
	TotalWorkingYears SMALLINT NOT NULL,
	TrainingTimesLastYear SMALLINT NOT NULL,
	YearsAtCompany SMALLINT NOT NULL,
	YearsInCurrentRole SMALLINT NOT NULL,
	YearsSinceLastPromotion SMALLINT NOT NULL,
	YearsWithCurrManager SMALLINT NOT NULL,
	BusinessTravelID INT,
	CONSTRAINT BusinessTravelFK FOREIGN KEY (BusinessTravelID)
        REFERENCES BusinessTravel(BusinessTravelID)
);
GO

CREATE TABLE Employee (
    EmployeeID INT PRIMARY KEY IDENTITY(1,1),
	Age SMALLINT NOT NULL, -- Armazena números inteiros de -32.768 a 32.767
	Attrition NVARCHAR(3) NOT NULL,
	CompensationID INT,
	CONSTRAINT CompensationFK FOREIGN KEY (CompensationID)
        REFERENCES Compensation(CompensationID),
	WorkHistoryID INT,
	CONSTRAINT WorkHistoryFK FOREIGN KEY (WorkHistoryID)
        REFERENCES WorkHistory(WorkHistoryID),
	GenderID INT,
	CONSTRAINT GenderFK FOREIGN KEY (GenderID)
        REFERENCES Gender(GenderID),
	MaritalStatusID INT,
	CONSTRAINT MaritalStatusFK FOREIGN KEY (MaritalStatusID)
        REFERENCES MaritalStatus(MaritalStatusID),
	Over18 NCHAR (1),
	EmployeeCount INT,
	HireDate DATE NOT NULL
);
GO

CREATE TABLE EmployeeAttributes (
	EnvironmentSatisfaction TINYINT NOT NULL, -- Armazena inteiros de 0 a 255
	JobInvolvement TINYINT NOT NULL,
	JobSatisfaction TINYINT NOT NULL,
	PerformanceRating TINYINT NOT NULL,
	RelationshipSatisfaction TINYINT NOT NULL,
	WorkLifeBalance TINYINT NOT NULL,
	JobLevel TINYINT NOT NULL,
	Education TINYINT NOT NULL,
	EmployeeID INT,
	CONSTRAINT EmployeeFK FOREIGN KEY (EmployeeID)
        REFERENCES Employee(EmployeeID),
	DepartmentID INT,
	CONSTRAINT DepartmentFK FOREIGN KEY (DepartmentID)
        REFERENCES Department(DepartmentID),
	EducationFieldID INT,
	CONSTRAINT EducationFieldFK FOREIGN KEY (EducationFieldID)
        REFERENCES EducationField(EducationFieldID),
	JobRoleID INT,
	CONSTRAINT JobRoleFK FOREIGN KEY (JobRoleID)
        REFERENCES JobRole(JobRoleID)
);
GO


